import { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import { getMovie, addRating, addReview, getReviews } from '../services/api';

function MovieDetail() {
  const { id } = useParams();
  const [movie, setMovie] = useState(null);
  const [reviews, setReviews] = useState([]);
  const [rating, setRating] = useState(0);
  const [review, setReview] = useState('');

  useEffect(() => {
    fetchMovie();
    fetchReviews();
  }, [id]);

  const fetchMovie = async () => {
    const { data } = await getMovie(id);
    setMovie(data.movie);
  };

  const fetchReviews = async () => {
    const { data } = await getReviews(id);
    setReviews(data);
  };

  const handleRating = async () => {
    await addRating(id, { rating });
    fetchMovie();
  };

  const handleReview = async () => {
    await addReview(id, { content: review });
    setReview('');
    fetchReviews();
  };

  if (!movie) return <div className="text-center py-8">Loading...</div>;

  return (
    <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
      <div className="bg-white rounded-lg shadow-md p-6">
        <div className="flex flex-col md:flex-row gap-6">
          <img
            src={movie.poster_path ? `/storage/${movie.poster_path}` : 'https://via.placeholder.com/300x450'}
            alt={movie.title}
            className="w-full md:w-1/3 rounded-lg object-cover"
          />
          <div className="flex-1">
            <h2 className="text-2xl font-bold">{movie.title}</h2>
            <p className="text-gray-600 mt-2">{movie.description}</p>
            <p className="mt-2"><strong>Release:</strong> {movie.release_date}</p>
            <p><strong>Duration:</strong> {movie.duration} minutes</p>
            <p><strong>Rating:</strong> {movie.ratings_avg_rating || 'No ratings'}</p>
          </div>
        </div>
        <div className="mt-6">
          <h3 className="text-lg font-semibold">Rate this movie</h3>
          <div className="flex items-center gap-4 mt-2">
            <input
              type="number"
              min="1"
              max="5"
              value={rating}
              onChange={(e) => setRating(e.target.value)}
              className="w-20 p-2 border rounded-md"
            />
            <button
              onClick={handleRating}
              className="px-4 py-2 bg-accent text-white rounded-md hover:bg-orange-600 transition"
            >
              Submit Rating
            </button>
          </div>
        </div>
        <div className="mt-6">
          <h3 className="text-lg font-semibold">Reviews</h3>
          <textarea
            value={review}
            onChange={(e) => setReview(e.target.value)}
            className="w-full p-2 border rounded-md mt-2"
            rows="4"
            placeholder="Write your review..."
          />
          <button
            onClick={handleReview}
            className="mt-2 px-4 py-2 bg-accent text-white rounded-md hover:bg-orange-600 transition"
          >
            Submit Review
          </button>
          <div className="mt-4 space-y-4">
            {Array.isArray(reviews) && reviews.length > 0 ? (
              reviews.map((rev) => (
                <div key={rev.id} className="bg-gray-100 p-4 rounded-md">
                  <p>{rev.content} - <strong>{rev.user.name}</strong></p>
                </div>
              ))
            ) : (
              <p className="text-gray-500">No reviews yet. Be the first to review!</p>
            )}
          </div>
        </div>
      </div>
    </div>
  );
}

export default MovieDetail;
